import React, { useState, useEffect } from 'react';
import './AgregarProducto.css';
import Navbar from '../components/Auth/Navbar';

const AgregarProducto = () => {
  const [nombre, setNombre] = useState('');
  const [precio, setPrecio] = useState('');
  const [fk_categoria, setCategoria] = useState('');
  const [fk_modelo, setModelo] = useState('');
  const [descripcion, setDescripcion] = useState('');
  const [existencia, setExistencia] = useState('');

  const [categorias, setCategorias] = useState([]);
  const [modelos, setModelos] = useState([]);

  useEffect(() => {
    // Obtener categorías
    fetch('/api/categorias')
      .then(res => res.json())
      .then(data => setCategorias(data))
      .catch(err => console.error('Error cargando categorías:', err));

    // Obtener modelos
    fetch('/api/modelos')
      .then(res => res.json())
      .then(data => setModelos(data))
      .catch(err => console.error('Error cargando modelos:', err));
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();

    const nuevoProducto = {
      nombre,
      descripcion,
      precio: parseFloat(precio),
      existencia: parseInt(existencia),
      fk_categoria: parseInt(fk_categoria),
      fk_modelo: parseInt(fk_modelo)
    };

    try {
      const res = await fetch('/api/productos', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify(nuevoProducto)
      });

      if (!res.ok) throw new Error('Error al guardar');

      alert('✅ Producto agregado correctamente');
      setNombre('');
      setPrecio('');
      setCategoria('');
      setModelo('');
      setDescripcion('');
      setExistencia('');
    } catch (err) {
      console.error(err);
      alert('❌ Hubo un error al guardar el producto');
    }
  };

  return (
    <div className="agregar-producto-page">
      <Navbar />
      <div className="form-container">
        <h2>Agregar Nuevo Producto</h2>
        <form onSubmit={handleSubmit}>
          <label>
            Nombre:
            <input type="text" value={nombre} onChange={(e) => setNombre(e.target.value)} required />
          </label>

          <label>
            Descripción:
            <textarea value={descripcion} onChange={(e) => setDescripcion(e.target.value)} required />
          </label>

          <label>
            Precio:
            <input type="number" step="0.01" value={precio} onChange={(e) => setPrecio(e.target.value)} required />
          </label>

          <label>
            Existencia:
            <input type="number" value={existencia} onChange={(e) => setExistencia(e.target.value)} required />
          </label>

          <label>
            Categoría:
            <select value={fk_categoria} onChange={(e) => setCategoria(e.target.value)} required>
              <option value="">Seleccione una categoría</option>
              {categorias.map(cat => (
                <option key={cat.id} value={cat.id}>{cat.nombre}</option>
              ))}
            </select>
          </label>

          <label>
            Modelo:
            <select value={fk_modelo} onChange={(e) => setModelo(e.target.value)} required>
              <option value="">Seleccione un modelo</option>
              {modelos.map(mod => (
                <option key={mod.id} value={mod.id}>{mod.modelo}</option>
              ))}
            </select>
          </label>

          <button type="submit">Guardar Producto</button>
        </form>
      </div>
    </div>
  );
};

export default AgregarProducto;
